"""## 7

![image.png](data:image/png;base64,)

##SOLUÇÃO

Para esse exercício, primeiramente, construimos o polinomio de Lagrange com base na função dada , e assim,  obtivemos:
 - Polinômio de Lagrange:

   [-7.29744254140026*x*(x - 1) + 2.0*x*(1 + 2*E)*(x - 0.5) + 2.0*(x - 1)*(x - 0.5)]

Após isso aplicamos para f(0.8). Assim, obtivemos o valor:
 - Aproximação de f(0.8): 1.52759080662404 + 0.96*E

Onde E representa a base do logaritmo natural (aproximadamente 2.71828).
"""



import sympy as sp

x = sp.symbols('x')

x0 = 0
x1 = 0.5
x2 = 1

f_x = 2 * x**2 * sp.exp(x) + 1

# Construir o polinômio de Lagrange
L0 = ((x - x1) * (x - x2)) / ((x0 - x1) * (x0 - x2))
L1 = ((x - x0) * (x - x2)) / ((x1 - x0) * (x1 - x2))
L2 = ((x - x0) * (x - x1)) / ((x2 - x0) * (x2 - x1))

polinomio_lagrange = f_x.subs(x, x0) * L0 + f_x.subs(x, x1) * L1 + f_x.subs(x, x2) * L2

# polinomio em x = 0.8
resultado = polinomio_lagrange.subs(x, 0.8)

print("Polinômio de Lagrange:")
print(polinomio_lagrange)
print("Aproximação de f(0.8):", resultado)